namespace App\Entities;

// Native components
use JsonSerializable;

// Doctrine components
use Doctrine\ORM\Mapping as ORM;

// 3rd party components
use Swagger\Annotations as SWG;
use Symfony\Component\HttpFoundation\Request;

/**
 * Class Image
 *
 * @SWG\Definition(
 *      title="Image",
 *      description="Image object that are attached to badges, and/or something else...",
 *      type="object",
 *      required={
 *          "filename",
 *          "mime",
 *          "data",
 *      },
 *      example={
 *          "hash": "xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx",
 *          "filename": "brotacon.png",
 *          "mime": "image/jpeg;",
 *          "data": "",
 *      },
 *  )
 *
 * @ORM\Table(
 *      name="image",
 *      uniqueConstraints={
 *          @ORM\UniqueConstraint(
 *              name="uq_hash",
 *              columns={"hash"}
 *          ),
 *      },
 *  )
 * @ORM\Entity(
 *      repositoryClass="App\Repositories\ImageRepository"
 *  )
 *
 * @category    Doctrine
 * @package     App\Entities
 * @author      TLe, Tarmo LeppÃ¤nen <tarmo.leppanen@protacon.com>
 */
class Image extends Base implements JsonSerializable
{
    /**
     * Image id
     *
     * @var integer
     *
     * @SWG\Property()
     * @ORM\Column(
     *      name="id",
     *      type="integer",
     *      nullable=false,
     *  )
     * @ORM\Id
     * @ORM\GeneratedValue(strategy="IDENTITY")
     */
    private $id;

    /**
     * UUID V4 hash for image
     *
     * @var string
     *
     * @SWG\Property()
     * @ORM\Column(
     *      name="hash",
     *      type="string",
     *      length=255,
     *      nullable=false,
     *  )
     */
    private $hash;

    /**
     * Original filename of the image
     *
     * @var string
     *
     * @SWG\Property()
     * @ORM\Column(
     *      name="filename",
     *      type="string",
     *      length=255,
     *      nullable=false,
     *  )
     */
    private $filename;

    /**
     * Mime type of the image
     *
     * @var string
     *
     * @SWG\Property()
     * @ORM\Column(
     *      name="mime",
     *      type="string",
     *      length=255,
     *      nullable=false,
     *  )
     */
    private $mime;

    /**
     * Actual image data as in base64 encoded
     *
     * @var string
     *
     * @SWG\Property()
     * @ORM\Column(
     *      name="data",
     *      type="blob",
     *      length=65535,
     *      nullable=false,
     *  )
     */
    private $data;

    /**
     * @return int
     */
    public function getId()
    {
        return $this->id;
    }

    /**
     * @return string
     */
    public function getHash()
    {
        return $this->hash;
    }

    /**
     * @return string
     */
    public function getFilename()
    {
        return $this->filename;
    }

    /**
     * @return string
     */
    public function getMime()
    {
        return $this->mime;
    }

    /**
     * @return string
     */
    public function getData()
    {
        return $this->data;
    }

    /**
     * @param string $hash
     *
     * @return Image
     */
    public function setHash($hash)
    {
        $this->hash = $hash;

        return $this;
    }

    /**
     * @param string $filename
     *
     * @return Image
     */
    public function setFilename($filename)
    {
        $this->filename = $filename;

        return $this;
    }

    /**
     * @param string $mime
     *
     * @return Image
     */
    public function setMime($mime)
    {
        $this->mime = $mime;

        return $this;
    }

    /**
     * @param string $data
     *
     * @return Image
     */
    public function setData($data)
    {
        $this->data = $data;

        return $this;
    }

    /**
     * Specify data which should be serialized to JSON
     *
     * @link  http://php.net/manual/en/jsonserializable.jsonserialize.php
     *
     * @return  array   data which can be serialized by json_encode, which is a value of any type other than a resource.
     */
    function jsonSerialize()
    {
        return [
            'hash'      => $this->getHash(),
            'filename'  => $this->getFilename(),
            'mime'      => $this->getMime(),
        ];
    }
}
